import classes from "../../styles/HeaderBurger.module.css";
import { NavLink } from "react-router-dom";
import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { activeBorgerAction, activeRegistAction } from "../../store/Burger";

function Registration() {
  const dispatch = useDispatch();
  const activRegist = useSelector((state) => state.burger.regist);
  const activeBurger = () => {
    dispatch(activeRegistAction(false));
  };

  return (
    <div className={classes.registForm}>
      <form className={classes.form} action="" method="post">
        <h1>РЕГИСТРАЦИЯ</h1>
        <input className={classes.input} type="text" placeholder="Ваше имя" />
        <input
          className={classes.input}
          type="email"
          placeholder="Ваш e-mail"
        />
        <input className={classes.input} type="tel" placeholder="Ваш телефон" />
        <input className={classes.input} type="password" placeholder="Пароль" />
        <input
          className={classes.input}
          type="password"
          placeholder="Пароль еще раз"
        />
        <button className={classes.btn} type="submit">
          Регистрация
        </button>
        <div style={{ marginTop: "15px" }}>
          <div style={{ float: "left", marginRight: "5px" }}>Нет аккаунта?</div>
          <NavLink
            style={{ float: "left", color: "#272727" }}
            onClick={() => activeBurger()}
          >
            Зарегиструруйся!
          </NavLink>
        </div>
      </form>
    </div>
  );
}

export default Registration;
